CREATE TEMPORARY TABLE IF NOT EXISTS table2 AS (
select case when sel.p1 = 1 then 1
		  when sel.p10 = 1 then 10
		  when sel.p11 = 1 then 11
		  when sel.p12 = 1 then 12
		  when sel.p18 = 1 then 18
		  when sel.p20 = 1 then 20
		  when sel.p21 = 1 then 21
		  when sel.p115 = 1 then 115
		  when sel.p171 = 1 then 171
		  when sel.p200 = 1 then 200
		  when sel.p202 = 1 then 202
		  else 999 end as ParkingZone, Lat, Lon  
from
(
	select MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp1) as p1,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp10) as p10,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp11) as p11,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp12) as p12,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp18) as p18,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp20) as p20,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp21) as p21,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp115) as p115,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp171) as p171,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp200) as p200,
		 MBRWithin(ST_GeomFromText(CONCAT('POINT(',pl1.Lon,' ',pl1.Lat,')')), @mp202) as p202, pl1.Lon, pl1.Lat, pl1.ParkingZoneId
	from parking_lot_copy pl1
) sel);

update parking_lot_copy pl set pl.ParkingZoneId = (
select ParkingZone from table2 t2 where t2.Lat = pl.Lat and t2.Lon = pl.Lon
limit 1
);*/

